import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Avatar from "@material-ui/core/Avatar";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import ListItemText from "@material-ui/core/ListItemText";
import DialogTitle from "@material-ui/core/DialogTitle";
import Dialog from "@material-ui/core/Dialog";
import PersonIcon from "@material-ui/icons/Person";
import AddIcon from "@material-ui/icons/Add";
import Typography from "@material-ui/core/Typography";
import blue from "@material-ui/core/colors/blue";
import { Divider, TextField, InputBase } from "@material-ui/core";
import PersonAddIcon from "@material-ui/icons/PersonAdd";
import { MuiThemeProvider, createMuiTheme } from "@material-ui/core/styles";
import DoneOutlinedIcon from "@material-ui/icons/DoneOutlined";

const styles = {
  avatar: {
    backgroundColor: blue[100],
    color: blue[600]
  }
};

const theme = createMuiTheme({
  overrides: {
    MuiInputBase: {
      input: {
        width: "513px",
        height: "1.875em",
        paddingLeft: "8px"
      }
    }
  }
});

class SimpleDialog extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      done: false,
      Collaborator:''
    };
  }
  doneClickhandle = event => {

    this.setState({
      Collaborator: event.target.value
    });
    console.log();



    this.setState({ done: true });
  };
  handleClose = () => {
    this.props.onClose(this.props.selectedValue);
  };
  donenotClickhandle=()=>{
    this.setState({ done: false });
  }
  handleListItemClick = value => {
    this.props.onClose(value);
  };

  handleClickClose = () => {
    console.log("dd");

    this.setState({
      open: false
    });
  };
  render() {
    const { classes, onClose, selectedValue, ...other } = this.props;

    return (
      <Dialog
        onClose={this.handleClose}
        aria-labelledby="simple-dialog-title"
        {...other}
      >
        <MuiThemeProvider theme={theme}>
          <div
            style={{
              display: "flex",
              flexWrap: "wrap",
              width: "600px",
              flexDirection: "column"
            }}
          >
            <span
              style={{
                padding: "2%",
                fontSize: "large",
                fontFamily: "inherit",
                fontStyle: "unset"
              }}
            >
              <b>Collaborators</b>
            </span>
            <span style={{ padding: "2%" }}>
              {" "}
              <Divider />
            </span>
            <span style={{ padding: "1%" }}>
              <Avatar></Avatar>
            </span>
            <div
              style={{
                display: "flex",
                justifyContent: "flex-start",
                flexDirection: "row",
                padding: "1%"
              }}
            >
              <span>
                <Avatar>
                  <PersonAddIcon />
                </Avatar>
              </span>
              <span>
                <InputBase
                  width="600px"
                  id="standard-basic"
                  placeholder="Person or email to share with"
                  onChange={this.doneClickhandle}
                />
              </span>
              {this.state.done !== false ? (
                <span>
                  <DoneOutlinedIcon  onClick={this.donenotClickhandle}  />
                </span>
              ) : null}
            </div>
            <div
              style={{
                display: "flex",
                justifyContent: "flex-end ",
                flexDirection: "row",
                padding: " 3%"
              }}
            >
              <span
                style={{ marginRight: "56px" }}
                onClick={this.handleClickClose}
              >
                Cancel
              </span>
              <span>Save</span>
            </div>
          </div>
        </MuiThemeProvider>
      </Dialog>
    );
  }
}

SimpleDialog.propTypes = {
  classes: PropTypes.object.isRequired,
  onClose: PropTypes.func,
  selectedValue: PropTypes.string
};

const SimpleDialogWrapped = withStyles(styles)(SimpleDialog);

class SimpleDialogDemo extends React.Component {
  state = {
    open: false
  };

  handleClickOpen = () => {
    this.setState({
      open: true
    });
  };

  handleClose = value => {
    this.setState({ selectedValue: value, open: false });
  };

  render() {
    return (
      <div>
        <br />
        <Button
          variant="outlined"
          color="primary"
          onClick={this.handleClickOpen}
        >
          Open simple dialog
        </Button>
        <SimpleDialogWrapped
          selectedValue={this.state.selectedValue}
          open={this.state.open}
          onClose={this.handleClose}
        />
      </div>
    );
  }
}

export default SimpleDialogDemo;
